}else if (firstProfile.private === true) {
        alert("This Profile is private... which means..This dude is scared")
    window.location.reload()
    console.log(firstProfile)
    }else if
         (firstProfile === fail){
            alert(" we cant find this dude")
          } 

          return (
              <div className= "profile-container">
